import React, { useState, useEffect } from "react";
import Redirect from "react-router";
import axios from "axios";
import CreateHabit from "./create-habit.component";

export default function Dashboard(props) {
  const [habits, setHabits] = useState([]);

  const handleLogoutClick = (data) => {
    props.history.push("/");
    props.handleLogout();
  };

  useEffect(() => {
    console.log("MOUNTTINGN");
    axios
      .get("http://localhost:5000/habits")
      .then((res) => console.log(res.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      <h1>Welcome {props.loggedInStatus && props.user.username} </h1>
      <h2></h2>
      <button onClick={handleLogoutClick}>Logout</button>
      <CreateHabit username={props.user.username} />
    </div>
  );
}
